export default function Header({ visible, textLeft, textRight, textCenter }) {
  if (visible !== "false") {

    return (



      <header class="flex justify-content-between flex-row py-3" style={{ backgroundColor: '#4a0511' }}>
        <p class="h5 ps-3" style={{ color: '#FFFFFF' }}> {textLeft}</p>
        <p class="h5" style={{ color: '#FFFFFF' }}> {textCenter}</p>
        <a class="h5  pe-3" style={{ color: '#FFFFFF' }} href="https://www.linkedin.com/in/abdulrahman-nadeem/" rel="noreferrer" target="_blank">{textRight}</a>
      </header >



    );

  }
}
